  input: 'TEXT,"F3XA","","We are amending this report for the following reasons:  On
    schedule B, contributions made to Luther for Congress appear to be excessive.  Our
    original report disclosed a $5000 contribution for the primary cycle.  This was
    incorrectly reported.  The receiving committee correctly reported it as $4000
    to primary and $1000 to general.  This was how it was intended.  Contributions
    to Thurman for Congress also appeared to be excessive.  A contribution originally
    reported on our year end 2001 report was voided in march but was mistakenly omitted
    from our original april quarterly report.  It now appears correctly on line 23
    as a voided disbursement.   In your letter from Sept. 25, 2002 you noted that
    on schedule A, a contribution received appears to be incompletely reported.  This
    contribution was from the Barona Band, a native american tribe.  We have clarified
    who the contributor is on our amendment."'
